import { useHistory } from "react-router-dom";
import "../Main.css";
import logo from "../images/molloy-logo.png";
export default function Main() {
  let history = useHistory();

  const handleClick = () => {
    history.push("/discover");
  };
  return (
    <main className="main">
      <img
        src={logo}
        className="molloy-logo"
        alt="logo of molloy university"
      ></img>
      <h1>Textbook Exchange</h1>
      <h3>Helping students with their textbook game</h3>
      <button onClick={handleClick}>Click here to discover</button>
    </main>
  );
}
